//testRunner

log.info testRunner.metaClass.methods*.name.unique().sort()

class Hello{

//define 3 variables below, note:  def for define is used here instead of int, etc
	def log;
	def context;
	def testRunner;

//define a construct
	def Hello(log, context, testRunner){
		this.log = log //this.log refers to the log defined in the class and log is referring to the argument from the constructor
		this.context = context
		this.testRunner = testRunner
	}

	def sayHello(String name){
		log.info ("   Hello "+name + "!");
	}
}

context.setProperty("Hello", new Hello(log, context, testRunner))

//make the Hello endpoint from TestCase 1 available here
project = testRunner.testCase.testSuite.project;
tcase = project.testSuites("TestSuite3").testCases("TestCase2");
hello = tcase.getTestStepByName("Hello");

hello.run(testRunner, context)

context.Hello.sayHello("Alicia")

