//groovy code to run test case
//=====================
def tCase = testRunner.testCase.testSuite.testCases["TestCase3"]

//define property and assign it to a variable, here it is called prop
def prop = new com.eviware.soapui.support.types.StringToObjectMap()

//run method's parameter are property and synchronous.  Here 1st parameter is prop and 2nd property can be set to true or false
//runner = tCase.run(prop, true);
//runner = tCase.run(prop, false);
runner = tCase.run(null, false);

log.info ("  >>>  "+runner.getStatus().toString())


/*groovy code to loop test cases in a test suite
==================================*/
def testCases = context.testCase.testSuite.getTestCaseList() 
testCases.each{
	log.info(it.name)

	if(it.name == "TestCase3") {
	log.info (" >> This is TestCase3")
	}
}

//print current testcase name where you are running the groovy script from

log.info ("  I am running the groovy script from:  "+testRunner.testCase.name)

//Run project using groovy script.  Note:  REST Project 1 is another project and you are running it inside CountryInfoService project, TestSuite3, TestCase4
//This means you can run a project somewhere else
//------------------
def projectName=testRunner.getTestCase().getTestSuite().getProject().getWorkspace().getProjectByName("REST Project 1")

//null is a property like new com.eviware.soapui.support.types.StringToObjectMap() but here null is used
